import Main from '../Home/Main';
import Project from './Project';

function Projects() {
	return (
		<div className='my-container'>
			{/* <div></div> */}
			<div>
				<h2 className='middle-title'>Projects</h2>
				<p className='my-3'>나의 프로젝트와 다른 프로젝트를 한 공간에.</p>
			</div>
			<div className='mb-8 mt-6 sm:mb-32 h-px bg-slate-300	'></div>
			<Project />
		</div>
	);
}

export default Projects;
